/*subscribe*/
.subscribe {
  width: 100%;
  height: 600px;
  max-height: 1500px;
  position: relative;
}

.subscribe__decor--bottom {
  position: absolute;
  bottom: 0;
  right: 3%;
  width: 12%;
}

.subscribe__fon--notHidden {
  width: 80%;
  height: 407px;
  max-height: 1000px;
  position: relative;
  margin: 7% auto;
}

.subscribe__fon--plain {
  position: absolute;
  top: -5%;
  right: -3%;
  z-index: 2;
  width: 7%;
}

.subscribe__fon {
  width: 100%;
  height: 407px;
  max-height: 1000px;
  background-color: rgba(223, 215, 249, 0.3);
  border-radius: 129px 20px 20px 20px;
  position: absolute;
  overflow: hidden;
  top: 0;
  left: 0;
}

.subscribe__fon h3 {
  font-family: "Poppins";
  font-style: bold;
  font-size: 2.06rem;
  line-height: 109%;
  text-align: center;
  color: #5e6282;
  padding: 10vh 5vw;
}

.subscribe__fon img:nth-child(1) {
  position: absolute;
  opacity: 20%;
  bottom: 0;
  left: 2%;
}

.subscribe__fon img:nth-child(2) {
  position: absolute;
  transform: rotate(270deg);
  top: 10%;
  right: -10%;
  opacity: 20%;
}

input[type=email] {
  background-image: url(/82335399685b1fef6920881c6208458a.png);
  background-color: white;
  background-repeat: no-repeat;
  padding-left: 9%;
  width: 33vw;
  height: 8vh;
  margin-left: 20%;
  border: none;
  border-radius: 10px;
  color: #39425d;
  font-size: 1rem;
  margin-right: 2%;
}

.btn {
  width: 10vw;
  height: 8vh;
  color: white;
  border-radius: 10px;
  padding: 10px 25px;
  background: linear-gradient(180deg, #ff946d 0%, #ff7d68 100%);
  font-family: "Open Sans";
  font-style: bold;
  font-size: 1rem;
  border: none;
}
.btn:hover {
  background: #e44120;
  box-shadow: 5px 5px 9px rgba(0, 0, 0, 0.9);
}

/*sponsor*/
.sponsor {
  width: 100%;
  min-height: 20vh;
  max-height: 200vh;
}

.sponsor ul {
  display: flex;
  align-items: baseline;
  flex-wrap: wrap;
  justify-content: space-evenly;
  padding: 0;
  margin: 0;
  padding-top: 25px;
}

.sponsor li {
  list-style: none;
  padding: 7px 0;
  border: 1px solid transparent;
  border-radius: 15px;
  box-shadow: 0px 100px 80px rgba(0, 0, 0, 0.02), 0px 64.8148px 46.8519px rgba(0, 0, 0, 0.0151852), 0px 38.5185px 25.4815px rgba(0, 0, 0, 0.0121481), 0px 20px 13px rgba(0, 0, 0, 0.01), 0px 8.14815px 6.51852px rgba(0, 0, 0, 0.00785185), 0px 1.85185px 3.14815px rgba(0, 0, 0, 0.00481481);
}

.sponsor ul li:hover {
  box-shadow: 0px 100px 80px rgba(0, 0, 0, 0.2), 0px 64.8148px 46.8519px rgba(0, 0, 0, 0.02), 0px 38.5185px 25.4815px rgba(0, 0, 0, 0.2), 0px 20px 13px rgba(0, 0, 0, 0.2), 0px 8.14815px 6.51852px rgba(0, 0, 0, 0.02), 0px 1.85185px 3.14815px rgba(0, 0, 0, 0.02);
