.footer__play2:hover {
  box-shadow: 5px 5px 9px rgba(0, 0, 0, 0.9);
}

.wrapperF {
  display: flex;
  justify-content: space-around;
}

.wrapperF .icon {
  position: relative;
  background-color: white;
  border-radius: 50%;
  padding: 15px;
  margin: 0 15px 30px 0;
  width: 50px;
  height: 50px;
  font-size: 18px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  flex-direction: column;
  box-shadow: 0 10px 10px rgba(0, 0, 0, 0.1);
  cursor: pointer;
  transition: all 0.2s cubic-bezier(0.68, -0.55, 0.265, 1.55);
}

.wrapperF .icon img {
  position: absolute;
  top: -4px;
  left: -0.4vw;
}

.wrapperF .instagram img {
  left: -0.55vw;
}

.wrapperF .tooltip {
  position: absolute;
  top: 0;
  font-size: 14px;
  background-color: white;
  color: white;
  padding: 5px 8px;
  border-radius: 5px;
  box-shadow: 0 10px 10px rgba(0, 0, 0, 0.1);
  opacity: 0;
  pointer-events: none;
  transition: all 0.3s cubic-bezier(0.68, -0.55, 0.265, 1.55);
}

.wrapperF .tooltip::before {
  position: absolute;
  content: "";
  height: 8px;
  width: 8px;
  background-color: white;
  bottom: -3px;
  left: 50%;
  transform: translate(-50%) rotate(45deg);
  transition: all 0.3s cubic-bezier(0.68, -0.55, 0.265, 1.55);
}

.wrapperF .icon:hover .tooltip {
  top: -45px;
  opacity: 1;
  visibility: visible;
  pointer-events: auto;
}

.wrapperF .icon:hover span,
.wrapperF .icon:hover .tooltip {
  text-shadow: 0px -1px 0px rgba(0, 0, 0, 0.1);
}

.wrapperF .facebook:hover,
.wrapperF .facebook:hover .tooltip,
.wrapperF .facebook:hover .tooltip::before {
  background-color: #3b5999;
  color: white;
}

.wrapperF .twitter:hover,
.wrapperF .twitter:hover .tooltip,
.wrapperF .twitter:hover .tooltip::before {
  background-color: #46c1f6;
  color: white;
}

.wrapperF .instagram:hover,
.wrapperF .instagram:hover .tooltip,
.wrapperF .instagram:hover .tooltip::before {
  background-color: #e1306c;
  color: white;
}

