@media screen and (max-width: 540px) {
  .services {
    height: 1650px;
  }

  .destinations {
    height: 1640px;
  }
}
@media screen and (max-width: 508px) {
  .trip__kard {
    width: 280px;
    height: 350px;
    margin-top: 8vh;
    margin-left: auto;
    margin-right: auto;
    padding: 2vh 3vw;
  }

  .header__text2 span {
    font-size: 1.4rem;
  }

  .hidden__kard {
    width: 240px;
    height: 100px;
    right: 17%;
    top: 60%;
  }

  .trip {
    height: 890px;
  }

  .subscribe {
    padding-top: 6%;
  }
}
@media screen and (max-width: 460px) {
  .header__text .header__button {
    margin-top: 20px;
  }

  .footer__logotip p:nth-child(2) {
    font-size: 0.7rem;
  }
}
@media screen and (max-width: 465px) {
  .header__text2 span {
    font-size: 1.2rem;
    line-height: 50%;
  }

  header {
    background-size: 75%;
  }

  .destination__kard--wrapper {
    width: 240px;
    height: 380px;
    margin-bottom: 0;
  }

  .desitnations__kards--text {
    width: 240px;
  }

  .destinations__decor {
    top: 80px;
    left: 200px;
  }

  .desitnations__kards--text p {
    font-size: 1rem;
    padding-bottom: 2vh;
    padding-left: 5vw;
  }

  .desitnations__kards--text span {
    padding-left: 9vw;
  }

  .desitnations__kards--time img {
    margin-left: 5vw;
    margin-top: 3vh;
  }

  .destinations {
    height: 1610px;
  }

  .desitnations__kards ul {
    height: 1500px;
  }

  .services__text h4,
.destination__text h4 {
    font-size: 1rem;
  }

  .wrapper {
    margin-top: 4vh;
    height: 68%;
  }

  .slaide__user {
    width: 280px;
    height: 230px;
    padding-top: 9vw;
  }

  .footer .footer__hidden2 {
    display: none;
  }
}
@media screen and (max-width: 448px) {
  .header__container p:nth-last-child(2) {
    font-size: 0.6rem;
    width: 190%;
  }
}
@media screen and (max-width: 420px) {
  nav a {
    font-size: 0.6rem;
  }

  header {
    height: 470px;
  }

  .wrapper {
    margin-top: 4vh;
    height: 65%;
  }

  .wrapper .controls {
    left: 25%;
  }

  .slaide__user {
    width: 240px;
    height: 270px;
    padding-top: 9vw;
  }

  .say {
    height: 720px;
  }

  .subscribe__fon--notHidden {
    height: 280px;
  }

  .subscribe__fon {
    height: 280px;
  }

  .subscribe__fon h3 {
    font-size: 1rem;
    line-height: 125%;
    padding: 11vh 5vw 8vh;
  }

  input[type=email] {
    width: 65%;
    margin-left: 2%;
    height: 5vh;
    font-size: 0.8rem;
    background-image: url(/634b22cb9a1264a8a7d3b590bab3b26b.png);
    padding-left: 18%;
  }

  .subscribe {
    height: 380px;
  }

  .custom-btn {
    width: 19%;
    font-size: 0.6rem;
    height: 5vh;
  }

  .trip {
    height: 820px;
  }

  .trip__info {
    height: 390px;
  }

  .trip__kard {
    margin-top: 20px;
  }

  .services {
    height: 1650px;
  }

  .services__kards {
    height: 1520px;
  }
}
@media screen and (max-width: 413px) {
  h1 {
    font-size: 1.85rem;
  }

  .services__text h2,
.destination__text h2,
.trip__info h2,
.say h2 {
    font-size: 1.5rem;
  }
}
@media screen and (max-width: 380px) {
  header {
    height: 450px;
  }

  .header__container p:nth-last-child(2) {
    margin-top: 2vh;
  }

  h1 {
    font-size: 1.75rem;
  }

  .services__text h2,
.destination__text h2,
.trip__info h2,
.say h2 {
    font-size: 1.3rem;
  }

  .header__text .header__button {
    margin-top: 2vh;
  }

  .destinations__decor {
    top: 80px;
    left: 170px;
  }

  .services {
    height: 1680px;
  }

  .trip {
    height: 850px;
  }

  .trip__info {
    height: 420px;
  }

  .trip__kard {
    margin-top: 20px;
  }

  .footer__logotip p:nth-child(2) {
    font-size: 0.6rem;
  }
}
@media screen and (max-width: 360px) {
  .services {
    height: 1640px;
  }

  .services__kards {
    height: 1530px;
  }

  .destinations {
    height: 1510px;
  }

  .desitnations__kards ul {
    height: 1400px;
  }

  .header__text2 span {
    font-size: 1rem;
  }
}
@media screen and (max-width: 330px) {
  .services {
    height: 1640px;
  }

  .destinations {
    height: 1500px;
  }

  .desitnations__kards ul {
    height: 1400px;
  }

  .slaide__user {
    width: 210px;
    height: 260px;
    padding-top: 12vw;
  }

  .say {
    height: 660px;
  }

  h1 {
    font-size: 1.5rem;
  }

  .services__text h2,
.destination__text h2,
.trip__info h2,
.say h2 {
    font-size: 1.2rem;
  }

  .footer__hidden3 {
    display: none;
  }
}

sources.style.scss:
$fon_color:rgb(255, 255, 255);
@font-face {
    font-family: "Google Sans";
    font-style: normal;
	font-weight: normal;
    src: url(./fonts/GoogleSans-Regular.woff) format("woff"), 
    url(./fonts/GoogleSans-Regular.woff2) format("woff2");
}

@font-face {
    font-family: "Poppins";
    font-style: normal;
	font-weight: normal;
	src: local("Poppins"),    
    url(./fonts/Poppinsregular.woff) format("woff"),
    url(./fonts/Poppinsregular.woff2) format("woff2"),    
    url(./fonts/Poppins-Regular.ttf) format("truetype");
}
@font-face {
    font-family: "Poppins";
    font-style: normal;
	font-weight: bold;
    src: local("Poppins"),     
    url(./fonts/poppins_bold.woff) format("woff"),
    url(./fonts/poppins_bold.woff2) format("woff2"),
    url(./fonts/Poppins-Bold.ttf) format("truetype"); 
}

@font-face {
    font-family: "Volkhov";
    font-style: normal;
	font-weight: bold;
    src: url(./fonts/volkhovbold.woff) format("woff"),
    url(./fonts/volkhovbold.woff2) format("woff2");
}
@font-face {
    font-family: "Open Sans";
    font-style: normal;
	font-weight: normal;
    src: url(./fonts/open_sans.woff) format("woff"),
    url(./fonts/open_sans.woff2) format("woff2");
}
/*header*/

*, *:before, *:after {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}
body {
    width: 100%;
    min-height: 4700px;
    max-height: 600%;
    background-color: $fon_color;
}
header {
    width: 100%;
    height: 900px;
    max-height: 2000px;      
    background-image: url(./img/Decore_header.png);
    background-color:  $fon_color;
    background-size: 55%;
    background-position: top right;
    background-repeat: no-repeat;              
}
nav {
    display: flex;
    width: 100%;
    height: 100px;
    max-height: 200px;
    padding-top: 5vh;
    padding-left: 9.5vw;      
    position: relative;
}
.header__imgLogo {    
    width: 114.91px;
    height: 33.99px;
    margin-right: 15vw;
}
.header__menu {
    list-style: none;
    display: inline-flex;
    padding-top: 2.2vh;
    justify-content: space-evenly;
    width: 100%;    
}
nav li {	
	list-style: none;
	display: inline-block;
}
nav a {
    font-family: "Google Sans";
    font-style: normal;
    font-weight: 500;
    font-size: 1.1rem;
    line-height: 1.3rem;
    color: rgb(33, 40, 50);
    text-decoration: none;
    border: 2px solid transparent;
    border-radius: 5px;
    padding: 0 1vw;       
}
nav a:hover {
    border-color: rgb(17, 86, 182);  
    color: rgb(37, 23, 168);        
}
.language {
    font-family: "Google Sans";
    border: none;
    background-color: rgb(255, 241, 218);  
    margin: 0;
    padding: 0;
}
/* header*/
.header__container {
    width: 100%;
    height: 750px;    
    max-height: 1500px;
    display: flex;
    margin-top: 2vh;           
}
.header__decor {
    position: absolute;
    top: 70px;
    left: -25px;  
    width: 170%;    
}
.text__decor {
    position: relative;      
}
.text__decor--word {
    z-index: 2;
    position: relative; 
}
.header__text {
    padding-left: 10vw;    
    width: 50%;      
}
.header__text h4  {
    padding-top: 13.5vh;
    padding-bottom: 2vh;
    font-family: "Poppins";
    font-style: normal;
	font-weight: bold;
    font-size: 1.25rem;
    line-height: 1.87rem;
    text-transform: uppercase;
    color: rgb(223, 105, 81);   
}
h1 {
    font-family: "Volkhov";
    font-style: normal;
    font-weight: bold;
    font-size: 4.5rem;
    color: rgb(24, 30, 75);   
    letter-spacing: -0.04em;      
}
.header__container p {
    font-family: "Poppins";
    font-style: normal;
    font-weight: 500;
    font-size: 1rem;
    line-height: 1.87rem;    
    color: rgb(94, 98, 130);
    width: 85%;   
    margin-top: 3vh;
}
.header__button {
    display: flex;
    margin-top: 7vh;
}
.header__button--orang {
    background: rgb(241, 165, 1);
    border-radius: 10px; 
    border: 1px solid rgb(241, 165, 1);
    width: 30%;     
    height: 60px;
    font-family: "Google Sans";    
    font-weight: 500;
    font-size: 1.125rem;
    line-height: 1.44rem;
    text-align: center;
    color:  $fon_color;
    text-shadow: 2px 2px 2px  rgba(15, 15, 15, 0.15);
    padding: 2vh 1vw;
}
.header__button--orang:hover {       
    box-shadow: 5px 5px 9px rgba(0, 0, 0, 0.9); 
    background: rgb(224, 123, 8);    
}
.header__button--red {
    background: rgb(223, 105, 81);    
    width: 54px;
    height: 54px;
    border: 1px solid rgb(223, 105, 81);
    border-radius: 50%;
    margin-left: 3.5vw;
}
.header__button--red:hover {  
    background: rgb(228, 65, 32);  
    box-shadow: 5px 5px 9px rgba(0, 0, 0, 0.9);    
}
.header__button p {
    font-family: "Poppins";    
    font-weight: 500;
    font-size: 1.06rem;
    color: rgb(104, 109,119);
    width: 20%; 
    margin-left: 1.7vw;
    margin-top: 2vh;
}
.header__img {
    width: 47%;
    min-width: 47%;    
}
.header__img img {
    width: 100%;
}
/*index_video */
.header__container2 {
    display: block;
    margin: 0 auto;
    text-align: center;
}
.header__text2 {       
    height: 150px;
    max-height: 300px;
    padding-top: 20px;
}
.header__text2 span {
    font-size: 2.5rem;   
    padding-top: 20px;
    margin-bottom: 20px;
    line-height: 2rem;
    font-family: "Volkhov";
    font-style: normal;
    font-weight: bold;    
    color: rgb(24, 30, 75);       
}

.custom-btn {
    width: 13%;
    height: 55px;
    margin-top: 20px;
    color: rgba(255, 255, 255, 1);
    text-shadow: 1px 1px 1px rgb(0, 0, 0) inset;
    border-radius: 10px;
    padding: 10px 25px;       
    background: linear-gradient(180deg, rgb(218, 98, 54) 0%, rgb(202, 54, 31) 100%);
    cursor: pointer;
    transition: all 0.3s ease;
    position: relative;
    display: inline-block;
     box-shadow:inset 2px 2px 2px 0px rgba(255,255,255,.5),
     7px 7px 20px 0px rgba(0,0,0,.1),
     4px 4px 5px 0px rgba(0,0,0,.1);
    outline: none;
    font-family: "Open Sans";
    font-style: bold;
    font-size: 1rem;        
  }  
 .btn-14 {
    background: linear-gradient(180deg, rgb(255, 148, 109) 0%, rgb(255, 125, 104) 100%);
    border: none;
    z-index: 1;
  }
  .btn-14:after {
    position: absolute;
    content: "";
    width: 100%;
    height: 0;
    top: 0;
    left: 0;
    z-index: -1;
    border-radius: 10px;
    background-color: rgb(234, 248, 24);
    background-image: linear-gradient(315deg, rgb(234, 248, 24) 0%, rgb(246, 252, 156) 74%);
     box-shadow: inset 2px 2px 2px 0px rgba(255,255,255,.5),
     7px 7px 20px 0px rgba(0,0,0,.1),
     4px 4px 5px 0px rgba(0,0,0,.1);
    transition: all 0.3s ease;
  }
  .btn-14:hover {
    color: rgb(0, 0, 0);
  }
  .btn-14:hover:after {
    top: auto;
    bottom: 0;
    height: 100%;
  }
  .btn-14:active {
    top: 2px;
  }
/*services*/
.services {
    height: 650px;
    max-height: 3000px;    
    width: 100%;
}
.services__name {
    height: 150px;   
    display: flex;    
    margin-top: 50px;
}
.services__text {
    width: 75%;
    margin-left: 10%;
}
.services__image img {
    width: 15%;
    position: absolute;
    right: 3%;
}
.services__text h4, .destination__text h4 {
    font-family: "Poppins";
    font-style: normal;
    font-weight: 600;
    font-size: 18px;
    line-height: 27px;
    text-align: center;
    color: rgb(94, 98, 130);     
    padding-top: 1vh;
    padding-bottom: 10px;
}
.services__text h2, .destination__text h2, .trip__info h2, .say h2 {
    font-family: "Volkhov";    
    font-weight: bold;
    font-size: 3rem;
    text-align: center;
    text-transform: capitalize;
    color: rgb(20, 24, 62);
}
.services__kards {   
    padding-top: 4vh;   
    margin-left: 0;
    height: 420px;
    max-height: 400%;    
}
.services__kards ul {
    display: flex;       
    margin-right: 3.8vw;
    margin-left: 1vw;
    padding-left: 0;
    justify-content: space-around;
    flex-wrap: wrap;
}
.kard {
    width: 280px;
    height: 370px;       
    list-style: none;   
}
.kard__main {
    width: 240px;
    height: 314px;   
    padding: 0 1.3vw;
    background-color:  $fon_color;   
    border-radius: 36px; 
    position: relative;    
    z-index: 1;
    margin: 0 0 auto auto;
    transition: 0.5s linear;
}
.kard__main img {
    height: 17vh;
    margin-left: 20%;
    padding-top: 4vh;       
}
.kard h3 {
    font-family: "Open Sans";    
    font-weight: 600;
    font-size: 1.25rem;
    line-height: 1.68rem;
    color: rgb(30, 29, 76);
    text-align: center;
    padding-top: 3.5vh;
    padding-bottom: 2vh;
}
.kard p {
    font-family: "Poppins";
    font-weight: 500;
    font-size: 1rem;
    line-height: 1.62rem;
    text-align: center;
    color: rgb(94, 98, 130);
}
.kard__decor {
    background-color:  $fon_color;
    position: relative;    
    width: 230px;
    height: 300px;   
    position: relative;    
    border-radius: 36px;  
    top: -300px; 
    left: 39px;
    transition: 0.5s linear;
    z-index: 0;       
}
.kard__decor img {
    padding-top: 75%; 
    margin-left: 5%; 
}
.kard:hover .kard__decor {   
    top: -250px; 
    left: 5px;
    z-index: 0;
}
.kard:hover .kard__main {       
    box-shadow: 0px 100px 80px rgba(0, 0, 0, 0.1), 0px 64.8148px 46.8519px rgba(0, 0, 0, 0.01), 0px 38.5185px 25.4815px rgba(0, 0, 0, 0.1), 0px 20px 13px rgba(0, 0, 0, 0.1), 0px 8.14815px 6.51852px rgba(0, 0, 0, 0.01), 0px 1.85185px 3.14815px rgba(0, 0, 0, 0.01);
    transform: scale(1.03);
}
.kard__main2 img {
    margin-left:  17%;            
}
.kard__main3 img {
    margin-left: 25%;        
}
.kard__main4 img {
    margin-left: 20%;
}
/*destinations*/
.destinations {
    margin-top: 50px;
    height: 780px;
    max-height: 3400px;    
    width: 100%;   
}
.destination__text h4 {
    text-transform: capitalize;
}
.desitnations__kards ul {
    display: flex;
    justify-content: space-around;
    flex-wrap: wrap; 
    padding: 0 7vw; 
    height: 600px;
    max-height: 2900px;   
}
.destination__kard--wrapper {
    width: 320px;
    height: 457px;    
    list-style: none; 
    margin-top: 7.5vh;   
    border-radius: 24px; 
    transition: 0.2s linear; 
    filter: drop-shadow(0px 100px 80px rgba(0, 0, 0, 0.02)) drop-shadow(0px 64.8148px 46.8519px rgba(0, 0, 0, 0.0151852)) drop-shadow(0px 38.5185px 25.4815px rgba(0, 0, 0, 0.0121481)) drop-shadow(0px 20px 13px rgba(0, 0, 0, 0.01)) drop-shadow(0px 8.14815px 6.51852px rgba(0, 0, 0, 0.00785185)) drop-shadow(0px 1.85185px 3.14815px rgba(0, 0, 0, 0.00481481));  
}
.destination__kard--wrapper:hover {
    transform: scale(1.07); 
    box-shadow: 0px 100px 80px rgba(0, 0, 0, 0.2), 0px 64.8148px 46.8519px rgba(0, 0, 0, 0.02), 0px 38.5185px 25.4815px rgba(0, 0, 0, 0.2), 0px 20px 13px rgba(0, 0, 0, 0.2), 0px 8.14815px 6.51852px rgba(0, 0, 0, 0.02), 0px 1.85185px 3.14815px rgba(0, 0, 0, 0.02);  
}
.destination__kard--wrapper:hover .desitnations__kards--text p  {
   color: rgb(231, 41, 82);
}
.desitnations__kards--text {
    width: 318px;
    height: 128px;
    border-radius: 0 0 24px 24px;
    background-color:  $fon_color;
    padding-top: 3vh;
    padding-left: 1.7vw;
    font-family: "Poppins";  
    line-height: 124.5%;  
    color: rgb(94, 98, 130);
    font-weight: 500;
}
.desitnations__kards--text p {   
    font-size: 1.125rem;  
    padding-bottom: 1.5vh;  
}
.desitnations__kards--text span {
    padding-left: 6.8vw;
}
.desitnations__kards--time span {     
    font-size: 1rem;   
    padding-left: 1vw;       
}   
.destinations__position {
    position: relative;
    z-index: 2;
}
.destinations__decor {
    position: absolute;
    top: 150px;
    left: 280px;
    z-index: 0;
}
.destination__kard--img:nth-child(1){
    width: 100%;
}
/*trip*/
.trip {
    width: 100%;
    height: 600px;
    max-height: 2200px;
    display: flex;
    flex-wrap: wrap;
    font-family: "Poppins";  
    font-style: normal;
    margin-bottom: 10vh;    
}
.trip__info {
    height: 550px;
    width: 50%;
    padding: 0 7vw;     
    text-align: left; 
}
.trip__info h6 {      
    font-weight: 600;
    font-size: 1.125rem;
    line-height: 1.69rem;         
    color: rgb(94, 98, 130);
    padding-top: 2vh;    
}
.trip__info h2 {     
    text-align: left; 
    padding-bottom: 1.93rem;
}
.trip__info ul {
    margin-left: 0;
    padding-left: 0;       
}
.trip__info li{
    list-style: none; 
    padding-bottom: 4vh;         
}
.trip__info img {   
    margin-top: 1vh;
    float: left; 
    width: 11%;   
}
.trip__text p {
    margin-left: 6vw;
    width: 75%;    
    font-weight: normal;
    font-size: 1rem;
    line-height: 124.5%; 
    color: rgb(94, 98, 130);   
}
.trip__kards {
    position: relative;   
    width: 50%;  
}
.trip__kards:hover .hidden__kard{
    visibility: visible;
}
.trip__kard {
    width: 370px;
    height: 400px;
    background-color:  $fon_color;
    box-shadow: 0px 100px 80px rgba(0, 0, 0, 0.1), 0px 64.8148px 46.8519px rgba(0, 0, 0, 0.01), 0px 38.5185px 25.4815px rgba(0, 0, 0, 0.1), 0px 20px 13px rgba(0, 0, 0, 0.1), 0px 8.14815px 6.51852px rgba(0, 0, 0, 0.01), 0px 1.85185px 3.14815px rgba(0, 0, 0, 0.01);
    border-radius: 26px;
    margin-top: 10vh;
    margin-left: 8vw;   
    padding: 2vh 1.5vw;
    position: relative;
}
.trip__kard img:nth-child(1){
    width: 100%;
}
.trip__kard h6{
    font-weight: 500;
    font-size: 18px;
    line-height: 124.5%;
    letter-spacing: 0.015em;
    color: rgb(8, 8, 9);
    padding-top: 4vh;
}
.trip__kard p{       
    font-weight: 500;
    font-size: 1rem;
    line-height: 124.5%;
    letter-spacing: -0.005em;  
    color: rgb(94, 98, 130);  
}
.trip__kard span {
    padding-left: .5vw;
    padding-right: 1vw; 
    font-weight: 500;
    font-size: 1rem;
    letter-spacing: -0.02em;
    color: rgb(94, 98, 130);      
}
.trip__kard ul {
    display: flex;      
