}
.slider {	
	position: relative;	
  width: 100%;
  height: 90%;    
}
.wrapper > input {
	display: none;
}

.wrapper .controls {
	left: -94%;	
	position: absolute;
  top: 55%;
}
.wrapper label:after {
	border: 2px solid rgb(221, 221, 221);
	content: " ";
	display: block;
	height: 12px;	
	position: absolute;
	width: 12px;	
	border-radius: 50%;  
}
.wrapper label {
	cursor: pointer;
	display: inline-block;
	height: 12px;
	margin: 15px 12px 15px;
	position: relative;
	width: 12px;	
	border-radius: 50%; 
  background-color: rgb(229, 229, 229);  
	transition: all ease-in-out .5s;
}

.wrapper label:hover, 
#slide1:checked ~ .controls label:nth-of-type(1),
#slide2:checked ~ .controls label:nth-of-type(2),
#slide3:checked ~ .controls label:nth-of-type(3)  {
	background-color: rgb(57, 66, 93);
}
.slides {
	opacity: 0;
	position: absolute;
	z-index: 0;
	transform: scale(1.1);
	transition: transform ease-in-out .5s, opacity ease-in-out .5s;
}

#slide1:checked ~ .slider > .slide1,
#slide2:checked ~ .slider > .slide2,
#slide3:checked ~ .slider > .slide3  {
	opacity: 1;
	z-index: 1;
	transform: scale(1);
}
#input[type=radio] {
  display: none;
}
.slaider__container {
  position: relative;  
  width: 90%;
  height: 260px;   
  overflow: hidden;
 }
.slaide__stop {
  position: absolute;
  right: 93%;
  top: 27%; 
  visibility: visible;
  transform: scale(0.9);
	transition: transform ease-in-out .5s, opacity ease-in-out .5s;  
}
.slaide__stop img {
   display: none;
} 
#arrow_next label, #arrow_prev label {
  color: rgba(167, 149, 149, 0.7);
  position: absolute;
  visibility: hidden;
  cursor: pointer;
  left: 105%;
  transform: rotate(90deg);
  font-size: 2rem;  
  border-radius: none; 
  background-color:  $fon_color;
  transition: none;  
}
#arrow_next label:after, #arrow_prev label:after {
	border: none;	
	border-radius: none;  
}
#arrow_prev label {
  top: 40%;
}
#arrow_next label {
 top: 25%;
}
#slide1:checked ~ #arrow_next label:nth-child(2),
#slide2:checked ~ #arrow_next label:nth-child(3),
#slide3:checked ~ #arrow_next label:nth-child(1),
#slide1:checked ~ #arrow_prev label:nth-child(3),
#slide2:checked ~ #arrow_prev label:nth-child(1),
#slide3:checked ~ #arrow_prev label:nth-child(2) {
  visibility: visible;  
}
#arrow_prev label:hover, #arrow_next label:hover,
#slide1:checked ~ .arrow_next label:nth-of-type(1),
#slide2:checked ~ .arrow_next label:nth-of-type(2),
#slide3:checked ~ .arrow_next label:nth-of-type(3)  {  
	color: rgb(7, 11, 24);
}
